package com.olympicRndBracketPrediction.domain;

public class Archer {

	private String archerName;
	private int rank;
	private int archerId;
	
	public Archer() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getArcherName() {
		return archerName;
	}
	public void setArcherName(String archerName) {
		this.archerName = archerName;
	}
	public int getRank() {
		return rank;
	}
	public void setRank(int rank) {
		this.rank = rank;
	}
	public int getArcherId() {
		return archerId;
	}
	public void setArcherId(int archerId) {
		this.archerId = archerId;
	}
	
	
}
